import React from 'react';
import AppNav from './AppNav';
import './App.css';
import {Container, Button, Form, FormGroup, Label, Input} from 'reactstrap';

function App() {
  return (
    <div>
    <AppNav/>
    <Container>





        <Form>

        <FormGroup>
            <Label for= "username" >User Name</Label>
            <Input  type= "text" name="username" id="username" placeholder="User Name" ></Input>
        </FormGroup>

        <FormGroup>
            <Label for= "email">E-mail</Label>
            <Input   type= "email" name="email" id="email" placeholder="E-mail"></Input>
        </FormGroup>

        <FormGroup>
            <Label for= "password">Password</Label>
            <Input  type={this.state.showPassword ? 'text': 'password'} name="password" id="password" placeholder="Password" onChange={this.handleChange} value={this.state.password}></Input>                        
        </FormGroup>

        <FormGroup>
            <Button color="primary" onClick={this.loginClicked}>Login</Button>{' '}
        </FormGroup>

        </Form>

    </Container>

</div>
  );
}

export default App;
